pinMode(led4, OUTPUT);<br />
pinMode (btn, INPUT);<br />
btnState = digitalRead(btn);   // read the initial state<br />
Serial.begin(9600);
}<br />
void loop(){<br />
val = digitalRead( btn);      // read input value and store it in val
if (val != btnState) {          // the button state has changed!<br />
if (val == HIGH) {                // check if the button is pressed<br />
if(lightOn&lt;5){<br />
lightOn++;<br />
}else{<br />
lightOn=0;<br />
}<br />
}<br />
}<br />
//control the light here
switch(lightOn){<br />
case 0:<br />
Serial.println(&quot;light off&quot;);<br />
for(int i=8;i&lt;=12;i++){<br />
digitalWrite(i,LOW);<br />
}<br />
break;
case 1:<br />
interval=1000;<br />
blinkem();<br />
break;<br />
